import React from 'react';
import PropTypes from 'prop-types';

const IsPrivateRoute = props => {
    const { path, ...isPrivateRouteProps } = props;
    console.log(path);
    let val = '/app';

    const response = path.includes(val);

    console.log(response);
    return response;
};

IsPrivateRoute.propTypes = {};

export default IsPrivateRoute;
